import logo from './logo.svg';
import './App.css';
import Navbar from './components/navbar';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import CartWidget from './components/CartWidget';

function App() {
  return (
    <div className="App">
        <Router>
        <Navbar />
        </Router>
        <CartWidget />
    </div>
    );
}

export default App;
